import React from 'react';
import { update } from '../Fetches';
import { createBrowserHistory } from 'history';
const history = createBrowserHistory();

class Billpage extends React.Component {
  constructor() {
    super();
    this.state = {
      amt: 0
    };
  }
  change = e => {
    this.setState({ amt: +e.target.value });
  };
  purchase = () => {
    update(this.props.location.state, this.props.history);
  };
  Cancelpurchase = () => {
    history.go(-1);
  };
  render() {
    return this.props.location.state ? <div>true</div> : <div>false</div>;
  }
}
export default Billpage;
